import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./Home";
import Testimonials from "./Testimonials";
function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/testimonials" element={<Testimonials />} />
      </Routes>
      <Footer />
    </Router>
  );
}
